import React from 'react'
import Foot from './Foot'

const Rad = () => {
  return (
    <div style={{ width: '32rem',height: '22rem',marginLeft: '15rem',marginRight:"1rem",marginTop:"0.8rem" }}>
      <iframe title="ITONICS Cloud"  xml="lang" src="https://teaser.itonics.io/radar/trendRadar?zoomonscroll=false&amp;cantogglezoom=true" width="250%" height="500" name="iFrame" data-service="teaser.itonics"></iframe>
      <Foot />
    </div>
  )
}

export default Rad
